import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../css/EditarLocatario.css';
import logo from '../img/logo.png';
import { useNavigate, useLocation } from 'react-router-dom';
import InputMask from 'react-input-mask';

function EditarLocatario() {
  const navigate = useNavigate();
  const location = useLocation();
  const cpfEdit = new URLSearchParams(location.search).get('CPF');

  const [selectedRow, setSelectedRow] = useState(null);
  const [locatarioData, setLocatarioData] = useState({
    dataNascimento: '',
    cep: '',
    numero: '',
    complemento: '',
    celular: '',
    cpf: '',
  });

  useEffect(() => {
    // Função para buscar os dados do locatário
    const fetchLocatarioData = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/api/locatarios/search?cpf=${cpfEdit}`);
        const data = response.data;

        // Preencher os campos com as informações obtidas
        setLocatarioData({
          dataNascimento: data.dataNascimento,
          cep: data.cep,
          numero: data.numero,
          complemento: data.complemento,
          celular: data.celular,
          cpf: data.cpf,
        });
      } catch (error) {
        console.error(error);
      }
    };

    fetchLocatarioData(); // Chamar a função de busca ao montar o componente
  }, [cpfEdit]); // Executar o efeito quando o valor de cpfEdit for alterado

  const handleSubmit = (e) => {
    e.preventDefault();
    axios
      .post('http://localhost:8080/api/editarlocatario')
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div className="EditarLocatario">
      <header className="EditarLocatario-header">
        <table>
          <tbody>
            <tr>
              <td colSpan="2">
                <img src={logo} className="rentfyLogoEditarLocatario" alt="logo" />
              </td>
            </tr>
            <tr>
              <td>
                <fieldset className="fieldset-custom">
                  <legend>Editar Locatário</legend>
                  <form id="cadastroLocatario" onSubmit={handleSubmit}>
                    <div className="form-group">
                      <label htmlFor="dataNascimento">Data de Nascimento</label>
                      <br />
                      <input
                        type="date"
                        id="dataNascimento"
                        className="rounded-input"
                        value={locatarioData.dataNascimento}
                        onChange={(e) =>
                          setLocatarioData({ ...locatarioData, dataNascimento: e.target.value })
                        }
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="cep">CEP</label>
                      <br />
                      <InputMask
                        mask="99999-999"
                        type="text"
                        id="cep"
                        className="rounded-input"
                        value={locatarioData.cep}
                        onChange={(e) => setLocatarioData({ ...locatarioData, cep: e.target.value })}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="numero">Número</label>
                      <br />
                      <input
                        type="text"
                        id="numero"
                        className="rounded-input"
                        value={locatarioData.numero}
                        onChange={(e) => setLocatarioData({ ...locatarioData, numero: e.target.value })}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="numero">Complemento</label>
                      <br />
                      <input
                        type="text"
                        id="complemento"
                        className="rounded-input"
                        value={locatarioData.complemento}
                        onChange={(e) => setLocatarioData({ ...locatarioData, complemento: e.target.value })}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="celular">Celular</label>
                      <br />
                      <input
                        type="tel"
                        id="celular"
                        className="rounded-input"
                        value={locatarioData.celular}
                        onChange={(e) => setLocatarioData({ ...locatarioData, celular: e.target.value })}
                      />
                    </div>

                    <div className="form-group">
                      <label htmlFor="cpf">CPF</label>
                      <br />
                      <InputMask
                        mask="999.999.999-99"
                        type="text"
                        id="cpf"
                        className="rounded-input"
                        value={locatarioData.cpf}
                        onChange={(e) => setLocatarioData({ ...locatarioData, cpf: e.target.value })}
                      />
                    </div>

                    <button className="btnCadastrarLocatario" type="submit">
                      Cadastrar Locatário
                    </button>
                  </form>
                </fieldset>
              </td>
            </tr>
          </tbody>
        </table>
      </header>
    </div>
  );
}

export default EditarLocatario;
